INSERT INTO `libros` VALUES (1,'48d73b6dd38f6332244d3e7f66b9ea1c','Don Quijote de la Mancha','Miguel de Cervantes Saavedra','978-9996152115',2015,'b324f2f24436784b4036c95b4071fa4f',4.95,'/uploads/85202444444.jpg','Narra las aventuras de Alonso Quijano, un hidalgo pobre que de tanto leer novelas de caballería acaba enloqueciendo y creyendo ser un caballero andante, nombrándose a sí mismo como don Quijote de la Mancha.',NULL,NULL,NULL,NULL,'2023-03-22',NULL),(2,'23c63aace70067c61c3f474a85c34331','Jicaras Tristes','Alfredo Espino','978-9992349687',2023,'30b273693e003ffa0514d9cdc4f97748',7.50,'/uploads/85202415906.jpg','Los 96 poemas de Jícaras Tristes se salvan del fuego crítico por la emoción desnuda del joven poeta. Su lirismo se recrea en la “indiana musa” y el amor se traslada, en sencillos madrigales, romances, letrillas y sonetos, a las cosas rurales.',NULL,NULL,NULL,NULL,'2023-03-22',NULL),(3,'a4a3530822ba217b8405f1cd03dc65f7','Boku no kokoro no yabai yatsu','Norio Sakurai','978-1648274251',2018,'e1e6123db811da45cc661901ab3ca235',17.50,'/uploads/85202444428.jpg','La historia se desarrolla alrededor de Kyoutarou Ichikawa, una persona que se encuentra al fondo del nivel de popularidad de su escuela, y que se esfuerza por limitar el impulso asesino que constantemente acosa a su alma.',NULL,NULL,NULL,NULL,'2023-03-22',NULL),(4,'d5655ff5950e7a42aaab0f000262b298','It','Stephen King','978-1501142970',1986,'f10628e63015920218ba1433b5c02e8b',29.00,'/uploads/85202412659.jpg','Tras veintisiete años de tranquilidad y lejanía, una antigua promesa infantil les hace volver al lugar en el que vivieron su infancia y juventud como una terrible pesadilla. Regresan a Derry para enfrentarse con su pasado y enterrar definitivamente todo.',NULL,NULL,NULL,NULL,'2023-03-23',NULL),(5,'9bfcacc59fb139dd7b011075a40542c3','100 años de soledad','Gabriel García Márquez','978-6070728792',1967,'b324f2f24436784b4036c95b4071fa4f',19.95,'/uploads/85202444433.png','Cuenta la saga de la familia Buendía y su maldición, que castiga el matrimonio entre parientes dándoles hijos con cola de cerdo. Como un río desbordante, a lo largo de un siglo se entretejerán sus destinos por medio de sucesos maravillosos.',NULL,NULL,NULL,NULL,'2023-03-23',NULL),(6,'4d214f36756f168fe08e0cd459bf6c31','Eloquent JavaScript','Marijn Haverbeke','978-1593279509',2018,'56f04f8f556e929c52f2fc7cb811ec74',13.40,'/uploads/85202444423.jpg','Va más allá de los guiones de cortar y pegar de los libros de recetas y te enseña a escribir código que es elegante y eficaz. Comenzará con los conceptos básicos de la programación y aprenderá a usar variables, estructuras de control, funciones y demás.',NULL,NULL,NULL,NULL,'2023-03-24',NULL),(7,'7f9ffad74f2ab584a4517a67ab5e4d7e','Robinson Crusoe','Daniel Dafoe','978-9996154591',0000,'086aef8c4810b4bb1258dbb3ba27e092',10.95,'/uploads/85202423014.jpg','El único superviviente de un naufragio, Robinson Crusoe, acaba varado en una isla desierta. En su diario, relata su batalla diaria para mantenerse con vida, mientras conquista el aislamiento.',NULL,NULL,NULL,NULL,'2023-03-25',NULL),(8,'6d38fd42946556eb146c00c4971de97e','Alicia en el país de las maravillas','Lewis Carroll','978-8414002162',0000,'aa882d936adbc9fb6bfdb04f5c7734e1',25.00,'/uploads/852024155604.jpg','Un día aburrido como tantos, Alicia se duerme y de este modo entra en el País de las Maravillas de la mano del Conejo Blanco. Allí conocerá a la Falsa Tortuga, la Reina de Corazones, el Gato de Chester, la Duquesa, el Sombrerero Loco a la Liebre y demás.',NULL,NULL,NULL,NULL,'2023-03-26',NULL),(9,'03ba29d1d4cf899818f4e4b41a115a4e','Luna de Plutón','Dross Rotzank','978-9507300967',2015,'086aef8c4810b4bb1258dbb3ba27e092',15.40,'/uploads/105202461720.jpg','En un lejano parque de diversiones y en plena misión secreta para defender a su amada luna de un peligroso emperador, la joven Claudia, hija de Metallus, conoce a Knaach, y juntos se embarcan en una odisea de sucesos desafortunados.',NULL,NULL,NULL,NULL,'2023-04-22',NULL),(10,'0f324fb9b91aa5afb0cc9b066957bc0c','Maldito karma','David Salfier','978-8432228582',2007,'7ccca6f1b27e5c45eabefa289c88b937',5.75,'/uploads/105202493107.jpg','La presentadora de televisión Kim Lange está en el mejor momento de su carrera cuando sufre un accidente y muere aplastada por el lavabo de una estación espacial rusa. En el más allá, Kim se entera de que ha acumulado mal karma a lo largo de su vida...',NULL,NULL,NULL,NULL,'2023-04-23',NULL),(11,'6418571833638ae6f5a8c2938352834a','La celestina','Fernando de Rojas','978-9996154959',0000,'b57e43f887fcf16ce94406fd5dc36f4b',2.80,'/uploads/115202400040.jpg','La loca pasión por Melibea, hija de un rico mercader, lleva al joven Calisto a romper todas las barreras y a aliarse con una vieja alcahueta. Desde el momento en que entra en escena, Celestina avasalla toda la obra hasta convertirse en un personaje...',NULL,NULL,NULL,NULL,'2023-04-23',NULL),(12,'f8bd6fbda4cbfe6eec7a598274fd0e6a','La divina comedia - Infierno','Dante Alighieri','978-1518711374',0000,'b324f2f24436784b4036c95b4071fa4f',12.45,'/uploads/1652024170856.jpg','Es un poema donde se mezcla la vida real con la sobrenatural, muestra la lucha entre la nada y la inmortalidad, una lucha donde se superponen tres reinos, tres mundos, logrando una suma de múltiples visuales que nunca se contradicen o se anulan.',NULL,NULL,NULL,NULL,'2023-04-24',NULL),(13,'e3a7c02332784025c2f44053b03483a6','Matilda','Roald Dahl','978-8420482873',1988,'2597cb7b602ceeea3aba0ab82ecc3b87',11.68,'/uploads/1652024171909.png','Matilda es una  vida lectora de solo cinco años. Sensible e inteligente,  todos la admiran menos sus mediocres padres, que la consideran una inútil. Además, tiene poderes extraños y maravillosos... Un día, Matilda decide liberarse y empieza a emplearlos.',NULL,NULL,NULL,NULL,'2023-04-24',NULL),(14,'53b87c38b6fc6da4f447def8ffd80159','El principito','Antoine de Saint Exupery','978-9996152054',2016,'2597cb7b602ceeea3aba0ab82ecc3b87',2.50,'/uploads/1652024174806.jpg','El Principito es una obra dedicada al niño que todos llevamos dentro, y que a veces olvidamos. Una obra divertida, ingeniosa, sencilla y al mismo tiempo profunda. Antoine de Saint Exupéry transmite valores esenciales y reflexiona sobre...',NULL,NULL,NULL,NULL,'2023-05-25',NULL),(15,'6519f373465697c800e05f8fb5d474e3','Eres Mía, Pequeña','Savemetonight','978-1278129742',2013,'b324f2f24436784b4036c95b4071fa4f',13.25,'/uploads/1652024181312.jpg','Savannah está enamorada de Michael, y hasta tiene un recuerdo de él donde, un día, de la nada, Michael le besa e impulsa a que su corazón sienta una posible esperanza de que él pueda conseguir quererla como ella le quiere.',NULL,NULL,NULL,NULL,'2023-05-25',NULL),(16,'e578d54c77aade256f434a9d4a97050e','El visitante','Stephen King','978-8401021190',2018,'a071079b0d1ef80612343d59a3cb134d',12.00,'/uploads/1652024215610.png','Un niño de once años ha sido brutalmente asesinado. Todas las pruebas apuntan a uno de los ciudadanos más queridos de Flint City: Terry Maitland, entrenador en la liga infantil, profesor de literatura, marido ejemplar y padre de dos niñas...',NULL,NULL,NULL,NULL,'2023-05-28',NULL),(17,'f5953ded4320a3cf654a64abd9814fcd','El Cid','Jean Pierre Corneille','978-8432145742',2015,'b57e43f887fcf16ce94406fd5dc36f4b',8.55,'/uploads/1652024220058.jpg','La presión de sentimientos y deberes contrapuestos hacen de este drama una obra maestra de valor indiscutible. La obra recrea Las mocedades del Cid, de Guillén de Castro. Ambos autores se basan en materiales legendarios...',NULL,NULL,NULL,NULL,'2023-06-21',NULL);
